import axios from "axios";
import React, { useState } from "react";

const Test = () => {
  let [test, testChange] = useState();

  return (
    <div>
      <p id="one">오늘 크롤링은 어ㅓ셨나요?</p>
      <p id="two">괜츈?</p>
      <button
        onClick={() => {
          axios.get("/sample/doC").then((result) => {
            testChange(result);
          });

          console.log(test);
        }}
      >
        ajax요청
      </button>
    </div>
  );
};

export default Test;
